    <div className="container z-10 fixed navbar__earthly flex rounded-[1.31rem] drop-shadow-lg items-center justify-between px-4 py-4 mx-auto w-9/12 h-16 bg-[( 255, 255, 255, 0.25 )] left-1/2 -translate-x-1/2 translate-y-4 backdrop-blur-[0.188rem] border border-solid border-[rgbs( 255, 255, 255, 0.18 )]">
      {/* logo */}
      <div className=" font-[itim] text-3xl pl-4 justify-center items-center  ">
        <p>earthly.ie</p>
      </div>
      {/* links */}
      <ul className="flex list-none gap-16 font-[inter] items-center justify-center text-lg pr-4 cursor-pointer">
        <li>Home</li>
        <li>Shop</li>
        <li>About Us</li>
        <li>
          <button className=" rounded-[0.563rem] bg-primaryTwo py-2 px-4">
            Get in Touch
          </button>
        </li>
        <li className="">
          <img src={navIcon} alt="Cart Icon" />
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
